if ( msg.action == "random") {

    setTimeout(() => {
        var v = Math.round(Math.random() * 100);
        node.status({
            fill: v < 20 ? "green" : (v < 40 ? "red" : (v < 60 ? "yellow" : (v < 80 ? "blue" : "grey" ))),
            shape: "dot",
            text: msg.verbose ? "R: " + msg.row + ", C: " + msg.column : ""
        })
    }, 125);

    if ( !msg.freeze ) {
        setTimeout(()=> { node.status({})}, (750 * Math.random()) + 250);
    }
}

if ( msg.action == "rolling") {
    var columns = [
        ["green",  "yellow", "red",    "blue",   "grey"],
        ["yellow", "red",    "blue",   "grey",   "green"],
        ["red",    "blue",   "grey",   "green",  "yellow"],
        ["blue",   "grey",   "green",  "yellow", "red"],
        ["grey",   "green",  "yellow", "red",    "blue"],
    ];

    var clr = columns[msg.row % columns.length][ msg.column % columns[0].length ];

    setTimeout(() => { node.status({ 
        fill: clr, 
        shape: "dot",
        text: msg.verbose ? "R: " + msg.row + ", C: " + msg.column : ""
    }) }, 250 * msg.column);

    if (!msg.freeze) {
        setTimeout(() => { node.status({}) }, 350 * (msg.column+1));
    }

    msg.column += 1;
}

if ( msg.action == "dotmatrix") {
    var uint_8 = /* 16px by 16px, column major, big endian. @ http://dotmatrixtool.com */
        [
            0xfe, 0xff, 0x40, 0x88, 0x20, 0x8c, 0xfe, 0x8a, 0x00, 0x71, 0x7c, 0x00, 0x82, 0xff, 0x7c, 0x99, 0x00, 0x99, 0xfe, 0x81, 0x82, 0x00, 0x7c, 0xff, 0x00, 0x81, 0xfe, 0x81, 0x92, 0x42, 0x82, 0x3c
        ];
    var b = uint_8.map((d) => { return ("000000000" + d.toString(2)).slice(-8) })

    var cidx = ((msg.column % 16)*2) + (msg.row > 7 ? 1 : 0);
    var ridx = msg.row % 8;

    setTimeout(() => {
        node.status({
            fill: b[cidx][ridx] == "1" ? "red" : "grey",
            shape: "dot",
            text: msg.verbose ? "R: " + msg.row + ", C: " + msg.column : ""
        })
    }, 250 * msg.column);

    if (!msg.freeze) {
        setTimeout(() => { node.status({}) }, 350 * (msg.column + 1));
    }

    msg.column += 1;
}

return msg;
